column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli 可接受直接 JSON 配置数据和包含该配置的文件名。在后一种情况下会读取该文件并将内容放到这个属性中。

例如：set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

用法：nmcli agent secret { help }

将 nmcli 作为网络管理器（NetworkManager）的密钥（secret）代理运行。当 NetworkManager 要求密码时，它将请求
注册的代理提供。这个命令将使 nmcli 保持运行，如果要求密码则会请求用户提供。

用法：nmcli agent polkit { help }

将 nmcli 注册为用于用户会话的 polkit 操作。
当 polkit 守护进程要求授权时，nmcli 询问用户后将其响应返回 polkit。

用法：nmcli connection export { 参数 | help }

参数 := [id | uuid | path] <ID> [<输出文件>]

导出连接。目前只支持 VPN 连接。数据会导出到标准输出或文件（如果给定了）。

用法：nmcli device reapply { 参数 | help }

参数 := <接口名称>

尝试将自上次应用以后对当前活动连接所做出的改变应用到设备中。

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
用法：nmcli device set { 参数 | help }

参数 := 设备 { 属性 [ 属性 ... ] }
设备 := [ifname] <接口名> 
属性 := { autoconnect { yes | no } |
        { managed { yes | no }

修改设备属性。

用法：nmcli device lldp { 参数 | help }

参数 := [list [ifname <接口名>]]

列出通过 LLDP 发现的邻居设备。可使用 "ifname" 选项列出具体接口的邻居设备。

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
用法：nmcli general { 命令 | help }

命令 := { status | hostname | permissions | logging }

  status

  hostname [<主机名>]

  permissions

  logging [level <日志级别>] [domains <日志域>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
用法：nmcli general status { help }

显示网络管理器（NetworkManager）的整体状态。
"status" 是默认操作，即 "nmcli gen" 调用 "nmcli gen status"

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
用法：nmcli networking { 命令 | help }

命令 := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
用法：nmcli radio { 命令 | help }

命令 := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
用法：nmcli radio all { 参数 | help }

参数 := [on | off]

获取所有无线电开关的状态，或者打开/关闭它们。

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
用法：nmcli radio wifi { 参数 | help }

参数 := [on | off]

获取 Wi-Fi 无线电开关的状态，或者打开/关闭它。

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
用法：nmcli radio wwan { 参数 | help }

参数 := [on | off]

获取移动宽带无线电开关的状态，或者打开/关闭它。
